import { useState } from "react";
import axios from "axios";

axios.defaults.baseURL = "http://localhost:5000";
axios.defaults.withCredentials = true;

function App() {
  const [inputs, setInputs] = useState({
    age: "",
    gender: "",
    ap_hi: "",
    ap_lo: "",
    cholesterol: "",
    gluc: "",
    smoke: "",
    alco: "",
    bmi: "",
  });
  const [output, setOutput] = useState(null);

  const handleChange = (e) => {
    setInputs({ ...inputs, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    try {
      const payload = Object.fromEntries(
        Object.entries(inputs).map(([k, v]) => [k, v === "" ? undefined : Number(v)])
      );
      const res = await axios.post("/predict_fit", payload, {
        headers: { "Content-Type": "application/json" },
        withCredentials: true,
      });
      setOutput(res.data);
    } catch (err) {
      console.error(err);
      alert("‚ö†Ô∏è  Make sure Flask is running and you are logged in via Google Fit.");
    }
  };

  const handleLogin = () => {
    window.open("http://localhost:5000/login", "_blank");
    alert("Login tab opened ‚Äî finish Google login, then return here and click Predict.");
  };

  return (
    <div style={{ padding: "30px 50px", fontFamily: "Arial, sans-serif" }}>
      <h1>üíó Hridamrit ‚Äî Health Predictor</h1>

      <div style={{ marginBottom: "20px" }}>
        <button onClick={handleLogin} style={{ padding: "8px 12px", marginRight: "10px" }}>
          Login with Google Fit
        </button>
        <button onClick={handleSubmit} style={{ padding: "8px 12px" }}>
          Predict
        </button>
      </div>

      <h3>üßç Manual Inputs</h3>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fill, 120px)",
          gap: "15px",
          marginBottom: "20px",
        }}
      >
        {Object.keys(inputs).map((key) => (
          <div key={key}>
            <label style={{ fontSize: "0.9rem" }}>{key}</label>
            <input
              type="number"
              name={key}
              value={inputs[key]}
              onChange={handleChange}
              style={{
                width: "100px",
                padding: "5px",
                borderRadius: "6px",
                border: "1px solid #ccc",
              }}
            />
          </div>
        ))}
      </div>

      {output && (
        <div style={{ display: "flex", flexWrap: "wrap", gap: "30px" }}>
          <div
            style={{
              flex: "1 1 250px",
              border: "1px solid #ddd",
              borderRadius: "12px",
              padding: "15px",
              backgroundColor: "#fafafa",
            }}
          >
            <h3>üìä Fit Data</h3>
            <p>Steps (avg/day): {output.fit_data.avg_steps.toFixed(1)}</p>
            <p>Calories (avg/day): {output.fit_data.avg_calories.toFixed(1)}</p>
            <p>Height: {output.fit_data.height.toFixed(2)} m</p>
            <p>Weight: {output.fit_data.weight.toFixed(1)} kg</p>
          </div>

          <div
            style={{
              flex: "1 1 250px",
              border: "1px solid #ddd",
              borderRadius: "12px",
              padding: "15px",
              backgroundColor: "#f0f7ff",
            }}
          >
            <h3>ü©∫ Prediction</h3>
            <p>
              Result: <strong>
                {output.predicted_class === 1 ? "High Risk" : "Low Risk"}
              </strong>
            </p>
            <p>Probability: {(output.probability * 100).toFixed(2)}%</p>
          </div>

          <div
            style={{
              flex: "1 1 250px",
              border: "1px solid #ddd",
              borderRadius: "12px",
              padding: "15px",
              backgroundColor: "#fff7e6",
            }}
          >
            <h3>üßæ Final Input Used by Model</h3>
            {Object.entries(output.manual_input).map(([key, val]) => (
              <p key={key}>
                {key}: {typeof val === "number" ? val.toFixed(2) : val}
              </p>
            ))}
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
